import React from "react";
import "../../Styles/Shared/Footer.scss";

function Footer() {
  return (
    <>
      <div className='footerHeader'>
        <h1>Join our community on</h1>
      </div>
      <div className='footer'></div>
    </>
  );
}

export default Footer;
